import React from 'react';
import "../styles/pages/orphanages-map.css";
import MapMarker from '../images/map-marker.svg';
import { Link } from 'react-router-dom';
import { FiPlus } from 'react-icons/fi'; 
import { Map, TileLayer} from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
function OrphanagesMap(){
  return(
    <div id="page-map">
      <aside>
        <header>
          <img src={MapMarker} alt="Marcador"></img>
          <h2>Escolha um orfanato no mapa</h2>
          <p>Muitas crianças estão esperando a sua visita :)</p>
        </header>
        <footer>
          <strong>São Paulo</strong>
          <span>São Paulo</span>
        </footer>
      </aside>
<Map
  center={[-23.6554971,-46.6415725]}
  zoom={15}
  style={
    {  width: '100%', height : '100%'}
  }>
   {/* <TileLayer url="https://a.tile.openstreetmap.org/{z}/{x}/{y}.png"/> */}
  </Map>

      <Link to="">
        <FiPlus size='32' className="create-orphanage" color="#FFF"/>
        <TileLayer url="https://api.mapbox.com/styles/v1/mapbox/light-v10/tiles/256/{z}/{x}/{y}@2x?access_token"/>
        </Link>

    </div>
  )
}
export default OrphanagesMap;
